import React from 'react';

import {NavLink, Link} from 'react-router-dom';

const Nav = () => {
    return (
        <>
            <div id="navBar">
                <div className="man">
                    <ul>
                        <li> <NavLink activeClassName="alink" className = "link"  to="/">Home </NavLink></li>
                        <li> <NavLink activeClassName="alink" className = "link"  to="/services">Services </NavLink></li>
                        <li> <NavLink activeClassName="alink" className = "link"  to="/about">About </NavLink></li>
                        <li> <NavLink activeClassName="alink" className = "link"  to="/contact">Contact </NavLink></li>
                    </ul>
                    </div>
                </div>
        </>
    )
}

export default Nav;
